description:
हाल नेपालमा न्यूनचापीय प्रणालीको प्रभाव रहेको छ ।&amp;nbsp;

जल तथा मौसम विज्ञान विभाग मौसम पूर्वानुमान महाशाखाका अनुसार आइतबार दिउँसो देशका उच्च पहाडी तथा हिमाली भागमा साधारणतया बादल लाग्ने तथा बाँकी भागमा आंशिक बादल लाग्नेछ ।&amp;nbsp;

कोशी, गण्डक

भारत आन्ध्र प्रदेशको गुन्टर जिल्लामा एक अत्यासलाग्दो घटना घटेको छ ।&amp;nbsp;

त्यहाँ एक महिलाले आफ्ना श्रीमानका लागि बिर्यानी बनाइन् । तर त्यस बिर्यानीको मुख्य सामग्री थियो- पिसेर मिसाइएका निदाउने गोली ।&amp;nbsp;

श्रीमान गहिरो निद्रामा परेपछि ती म

राष्ट्रियसभामा रिक्त १८ पदका (यसमध्ये एक निर्विरोध निर्वाचित भइसकेका) लागि आज आइतबार निर्वाचन हुँदैछ ।&amp;nbsp;

तीमध्ये लुम्बिनी प्रदेशबाट महिला एक, अपांगता भएकातर्फ एक र अन्य एक गरी ३ पदका लागि चुनाव हुँदैछ ।&amp;nbsp;

नेपाली कांग्रेस र नेकपा एमा

नेपाल राष्ट्र बैंकले आज (आइतबारका)का लागि विदेशी मुद्राको विनिमयदर निर्धारण गरेको छ ।&amp;nbsp;

निर्धारण गरिएको विनिमयदरअनुसार अमेरिकी डलर एकको खरिददर १४६ रूपैयाँ &amp;nbsp;८१ पैसा र बिक्रीदर १४७ रूपैयाँ &amp;nbsp;४१ पैसा तोकिएको छ ।&amp;nbsp;

